import React from 'react';
import DetallesAgencias from './DetallesAgencias';
import './DetallesAgencias.css';

const ListaAgencias = () => {
  const empresasData = [
    {
      nombre: "Olva Courier",
      direccion: "Avenida Argentina 4458, Callao, Perú",
      evaluaciones: 12,
      valoracion: 4,
      telefono: "5664649",
      horarios: "Lunes a sábado de 9am a 7pm",
      web: "https://www.olvacourier.com/",
      correo: "ventas@olva.com.pe",
      estacionamiento: "No",
      recojoDomicilio: "No",
      entregaDomicilio: "Sí",
      seguimientoPedido: "Sí",
      mapaUrl: "https://www.google.com/maps/place/Olva+Courier+Central/@-12.0486303,-77.0993648,15z/data=!4m6!3m5!1s0x9105c954339772e7:0xa66e7836d17a0617!8m2!3d-12.0486303!4d-77.0993648!16s%2Fg%2F11bxc7kpx2?entry=ttu",
      mapaImageUrl: "/ruta/a/la/imagen/del/mapa", // Asegúrate de tener la imagen del mapa
      logoUrl: "/ruta/a/la/imagen/del/logo" // Asegúrate de tener la imagen del logo
    },
    // Más empresas
  ];

  return (
    <div className="lista-agencias">
      {empresasData.map((empresa, index) => (
        <DetallesAgencias key={index} empresa={empresa} />
      ))}
    </div>
  );
};

export default ListaAgencias;
